import React, { Component } from 'react';

// react-router-dom imports
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const Lobby = (props) => (
  <React.Fragment>
    <h2>Join</h2>
    <form>
      <input type='text' />
      <input type='submit' value='Join' onClick={ this.props.clickHandler } />
    </form>
  </React.Fragment>
);

class JoinComponent extends Component {

  constructor() {
    super();
    this.clickHandler = this.clickHandler.bind(this);
  }

  componentDidMount() {
    console.log(this.props.match);
  }

  clickHandler(event) {
    event.preventDefault();

  }

  render() {
    return(
      <Route exact path={ this.props.match.path } render={ <Lobby clickHandler={ this.clickHandler }/>} />
    );
  };

};

export default JoinComponent;
